Last weeks I have spent a lot of days at this crag Byci skala. Among the routes I I have done, this one is interesting. I have been looking at this section of the rock for exactly 17 years, trying to find some holds 🤔 I thought it was impossible. Some weeks ago I found enough holds and creative beta to make this section possible. Kamzík project (Chamois project) 8c (+)? 💪

